import React, { useState } from 'react';
import { Bar, Line, Bubble } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, PointElement, LineElement, Title, Tooltip, Legend);

const Dashboard = () => {
  const [clicked, setClicked] = useState({ mood: false, bubble: false, line: false, activity: false });

  const moodData = {
    labels: ['Item 1', 'Item 2', 'Item 3', 'Item 4', 'Item 5', 'Item 6', 'Item 7'],
    datasets: [
      { label: 'Item 1', data: [5], backgroundColor: 'rgba(255, 182, 193, 0.6)' },
      { label: 'Item 2', data: [10], backgroundColor: 'rgba(255, 182, 193, 0.6)' },
      { label: 'Item 3', data: [15], backgroundColor: 'rgba(255, 182, 193, 0.6)' },
      { label: 'Item 4', data: [20], backgroundColor: 'rgba(255, 160, 180, 0.6)' },
      { label: 'Item 5', data: [25], backgroundColor: 'rgba(255, 160, 180, 0.6)' },
      { label: 'Item 6', data: [30], backgroundColor: 'rgba(255, 105, 180, 0.6)' },
      { label: 'Item 7', data: [15], backgroundColor: 'rgba(255, 192, 203, 0.6)' },
    ],
  };

  const lineData = {
    labels: ['Jan', 'Feb', 'March', 'April', 'May', 'June'],
    datasets: [
      { label: 'Plans', data: [5, 10, 12, 15, 18, 20], borderColor: 'rgba(255, 182, 193, 0.8)', fill: false },
      { label: 'Bundles', data: [3, 7, 10, 14, 18, 25], borderColor: 'rgba(255, 105, 180, 0.8)', fill: false },
      { label: 'Products', data: [2, 4, 6, 8, 10, 12], borderColor: 'rgba(255, 160, 180, 0.8)', fill: false },
    ],
  };

  const bubbleData = {
    datasets: [
      {
        label: 'Your days so far',
        data: [
          { x: 10, y: 20, r: 15 },
          { x: 20, y: 30, r: 20 },
          { x: 30, y: 40, r: 25 },
          { x: 40, y: 50, r: 20 },
          { x: 50, y: 60, r: 15 },
          { x: 60, y: 70, r: 10 },
          { x: 70, y: 80, r: 15 },
        ],
        backgroundColor: 'rgba(255, 182, 193, 0.6)',
      },
    ],
  };

  const activityData = {
    labels: ['Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec', 'Jan', 'Feb', 'Mar'],
    datasets: [
      {
        label: 'Activity',
        data: [1, 2, 3, 4, 5, 6, 7, 8, 7, 6, 5, 4],
        backgroundColor: (context) => {
          const value = context.dataset.data[context.dataIndex];
          return value > 6 ? 'rgba(255, 105, 180, 0.7)' : value > 3 ? 'rgba(255, 160, 180, 0.7)' : 'rgba(255, 192, 203, 0.7)';
        },
        borderColor: 'rgba(255, 105, 180, 1)',
        borderWidth: 1,
      },
    ],
  };

  const handleClick = (section) => {
    setClicked((prev) => ({ ...prev, [section]: !prev[section] }));
  };

  const chartOptions = {
    responsive: true,
    plugins: { legend: { position: 'top' }, title: { display: false } },
    animation: { duration: 1000, easing: 'easeInOutQuad' },
    scales: { y: { beginAtZero: true } },
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-pink-50 via-pink-100 to-pink-200 p-8 flex flex-wrap gap-6 justify-center">
      <div
        className="bg-pink-100/90 p-6 rounded-3xl shadow hover:shadow-xl transition-all duration-300 max-w-md w-full"
        onClick={() => handleClick('mood')}
      >
        <h2 className="text-2xl font-bold text-pink-700 mb-4 font-sacramento text-center">ðŸŒ¸ Mood Past 7 Days</h2>
        <Bar data={moodData} options={chartOptions} />
      </div>

      <div
        className="bg-pink-50 p-6 rounded-3xl shadow hover:shadow-xl transition-all duration-300 max-w-md w-full"
        onClick={() => handleClick('bubble')}
      >
        <h2 className="text-2xl font-bold text-pink-600 mb-4 font-sacramento text-center">ðŸ’– Your Days So Far</h2>
        <Bubble data={bubbleData} options={chartOptions} />
      </div>

      <div
        className="bg-pink-200/90 p-6 rounded-3xl shadow hover:shadow-xl transition-all duration-300 flex items-center max-w-md w-full"
      >
        <img
          src="https://via.placeholder.com/80"
          alt="Marua"
          className="rounded-full border-4 border-pink-300 shadow mr-4"
        />
        <div>
          <h2 className="text-2xl font-bold text-pink-700 font-sacramento">Marua</h2>
          <div className="bg-pink-400/80 px-3 py-1 rounded-full text-white mt-2 shadow-sm">
            How are you feeling today?
          </div>
        </div>
      </div>

      <div
        className="bg-pink-50 p-6 rounded-3xl shadow hover:shadow-xl transition-all duration-300 max-w-md w-full"
        onClick={() => handleClick('line')}
      >
        <h2 className="text-2xl font-bold text-pink-700 mb-4 font-sacramento text-center">
          âœ¨ Revenue Growth (Q2)
        </h2>
        <Line data={lineData} options={chartOptions} />
      </div>

      <div
        className="bg-pink-100/90 p-6 rounded-3xl shadow hover:shadow-xl transition-all duration-300 max-w-md w-full"
        onClick={() => handleClick('activity')}
      >
        <h2 className="text-2xl font-bold text-pink-700 mb-2 font-sacramento text-center">
          ðŸŒ· Activity & Streak
        </h2>
        <p className="text-pink-600 text-center">Total Active Days: <strong>12</strong></p>
        <p className="text-pink-600 text-center">Happy Days: <strong>6</strong></p>
        <p className="text-pink-600 text-center">Sad Days: <strong>6</strong></p>
        <p className="text-pink-600 text-center">Most Common Emotion: <strong>ðŸ˜Š Happy</strong></p>
        <p className="text-pink-600 text-center">Current Streak: <strong>8</strong></p>
        <p className="text-pink-600 text-center mb-4">Max Streak: <strong>8</strong></p>
        <Bar
          data={activityData}
          options={{
            ...chartOptions,
            animation: {
              duration: clicked.activity ? 0 : 1000,
              easing: 'easeOutCubic',
            },
          }}
        />
        <p className="text-pink-500 text-sm mt-2 text-center cursor-pointer">
          ðŸŒ¸ Learn how we count contributions
        </p>
      </div>
    </div>
  );
};

export default Dashboard;
